script: |
  super -f text -I q11083.spq | sort > q11083.out

inputs:
  - name: q11083.spq
    data: |
      SELECT + col1 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col0 + - 67 + - - 53 * - col2 NOT IN ( - col1 * - + col0 + - 98 * + 92 * 55 + 50, - 95, - 74 );
  - name: tab1

outputs:
  - name: q11083.out
    data: |
